import React from "react";
import Link from "next/link";
import { withFormik, Form, Field } from "formik";

const SearchSites = (props) => {
  return (
    <>
      <div>
        <div
          className="uk-grid uk-grid-stack uk-grid-small uk-flex-middle uk-child-width-auto@m"
          uk-grid="">
          <div>
            <Link href="/">
              <a
                className="uk-link-reset uk-text-bold "
                style={{ color: "white" }}>
                <span className="uk-icon tm-text-white" uk-icon="plus"></span>
                <span>Add Filter</span>
              </a>
            </Link>
          </div>
          <div>
            <Form className="">
              <div className="uk-child-width-expand@m uk-width-1-1@m uk-width-medium uk-margin-auto">
                <div>
                  <div className="uk-inline uk-form-controls">
                    <span
                      className="uk-form-icon"
                      uk-icon="icon: search"></span>
                    <Field
                      className="uk-input uk-width-medium@m uk-margin-small-right"
                      name="search"
                      type="text"
                      placeholder="Search sites"
                      style={{ background: "transparent" }}
                      // onInput={(evt)=>searchHandler(evt.target.value)}
                    />
                  </div>
                  {/* <button className="uk-button uk-button-text uk-text-capitalize uk-text-muted">
                  Cancel
                </button> */}
                </div>
              </div>
            </Form>
          </div>
        </div>
      </div>
      <style jsx>
        {`
          .height {
            height: 60px;
          }

          .search_padding {
            display: flex;
            justify-content: center;
            align-items: center;
            box-sizing: border-box;
            min-height: 80px;
          }

          .button_padding {
            padding: 10px;
          }

          .logo_padding {
            padding: 8px 6px;
          }

          .logo_padding > span {
            padding: 2px 4px;
          }

          .signup_padding {
            padding-left: 5px;
            padding-right: 10px;
          }

          .signup_dropdown {
            width: 220px;
          }

          .zIndex {
            z-index: 100;
          }
        `}
      </style>
    </>
  );
};

const FormikSearchForm = withFormik({
  mapPropsToValues({ search }) {
    return {
      search: search || "",
    };
  },
  handleSubmit(values, { props, resetForm, setErrors, setSubmitting }) {
    resetForm();
    props.searchHandler("");
  },
})(SearchSites);

export default FormikSearchForm;
